import linkedin from'../../Asset/Img/linkdins.png';
import github from'../../Asset/Img/github.png';
import mail from'../../Asset/Img/mail.png';
import frenchFlag from '../../Asset/Img/frenchFlag.png'
import englishFlag from '../../Asset/Img/englishFlag.png'

const alt=["image linkedin","image github","image boite mail","drapeau Français","drapeau Anglais"];
const srcImg=[linkedin,github,mail,frenchFlag,englishFlag];

const tabImgNav = {
    alt:alt,
    srcImg:srcImg
}

export default tabImgNav;
